(window.webpackJsonp=window.webpackJsonp||[]).push([[3],{211:function(A,e,a){"use strict";a.r(e);var n=a(216),t=a(0),s=a.n(t),i=a(209),o=a(20),l=a(217),g=a.n(l);e.default=function(){var A=n.data;return s.a.createElement(i.a,null,s.a.createElement("div",{className:g.a.container},s.a.createElement("h2",null,"Historical"),s.a.createElement("ul",null,A.allMarkdownRemark.edges.map((function(A){return s.a.createElement("li",null,s.a.createElement(o.Link,{to:"/blog/"+A.node.fields.slug},s.a.createElement("h3",null,A.node.frontmatter.title)))})))))}},216:function(A){A.exports=JSON.parse('{"data":{"allMarkdownRemark":{"edges":[{"node":{"frontmatter":{"title":"Week 1 of November Cycle","date":"aa"},"fields":{"slug":"nov-19-week1"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50.55350553505535%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/a954ae7f2b429e6016461466e45b6b35/2d017/nov-19-week1.jpg\\"\\n        srcset=\\"/7seals/static/a954ae7f2b429e6016461466e45b6b35/40f63/nov-19-week1.jpg 225w,\\n/7seals/static/a954ae7f2b429e6016461466e45b6b35/df2c7/nov-19-week1.jpg 450w,\\n/7seals/static/a954ae7f2b429e6016461466e45b6b35/2d017/nov-19-week1.jpg 900w,\\n/7seals/static/a954ae7f2b429e6016461466e45b6b35/bbff7/nov-19-week1.jpg 1350w,\\n/7seals/static/a954ae7f2b429e6016461466e45b6b35/2e71c/nov-19-week1.jpg 1626w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>11/9/19</h3>\\n<p>Just reposted this in case it hadn\'t been put in yet. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 2 of November Cycle","date":"bb"},"fields":{"slug":"Nov-19-week2"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 59.0347923681257%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/2d017/nov-19-week2.jpg\\"\\n        srcset=\\"/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/40f63/nov-19-week2.jpg 225w,\\n/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/df2c7/nov-19-week2.jpg 450w,\\n/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/2d017/nov-19-week2.jpg 900w,\\n/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/bbff7/nov-19-week2.jpg 1350w,\\n/7seals/static/1f072dfb5a56f3a2ea7acd0348a33cf5/1964d/nov-19-week2.jpg 1782w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>11/11/19</h3>\\n<p>\\"McGhee\\"\\nIt\'s been a long time since I\'ve done this one.  Like ACF long. As always, focus on non-fail push ups.</p>\\n</li>\\n<li>\\n<h3>11/12/19</h3>\\n<p>Heavy day. Watch \\"bouncing\\" on bent over rows. </p>\\n</li>\\n<li>\\n<h3>11/13/19</h3>\\n<p>Every 3 minutes row 500m and then AMRAP situps.  Score total situps.</p>\\n</li>\\n<li>\\n<h3>11/15/19</h3>\\n<p>Think \\"DT\\" kb style with russian KB swings.  If time allows, focus on the \\"strict\\" part of the t2b. </p>\\n</li>\\n<li>\\n<h3>11/16/19</h3>\\n<p>Team size can be whatever works.  3+ would be ideal, or there\'s no rest. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 3 of November Cycle","date":"cc"},"fields":{"slug":"nov-19-week3"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 45.99774520856821%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/ac18170f2138c0be6511395dcca44ff7/2d017/nov-19-week3.jpg\\"\\n        srcset=\\"/7seals/static/ac18170f2138c0be6511395dcca44ff7/40f63/nov-19-week3.jpg 225w,\\n/7seals/static/ac18170f2138c0be6511395dcca44ff7/df2c7/nov-19-week3.jpg 450w,\\n/7seals/static/ac18170f2138c0be6511395dcca44ff7/2d017/nov-19-week3.jpg 900w,\\n/7seals/static/ac18170f2138c0be6511395dcca44ff7/bbff7/nov-19-week3.jpg 1350w,\\n/7seals/static/ac18170f2138c0be6511395dcca44ff7/085ce/nov-19-week3.jpg 1774w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>11/18/19</h3>\\n<p>The feedback was so good on this one, I had to revisit it.</p>\\n</li>\\n<li>\\n<h3>11/19/19</h3>\\n<p>Very clear. Yes I know there\'s two days of AB in a row. Sorry. </p>\\n</li>\\n<li>\\n<h3>11/20/19</h3>\\n<p>This is stupid hard. Might want to cap it at 40m? For those that think 95/65 is too light, they\'re wrong.</p>\\n</li>\\n<li>\\n<h3>11/22/19</h3>\\n<p>Clear with some skill work to follow.</p>\\n</li>\\n<li>\\n<h3>11/23/19</h3>\\n<p>Depending on numbers and equipment, half teams can start with AB, half with row.  Just alternate.  As long as more than one round is completed, it will even out. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 4 of November Cycle","date":"dd"},"fields":{"slug":"nov-19-week4"},"html":"<p><img src=\\"./nov-19-week4.jpg\\" alt=\\"workouts\\"></p>\\n<ul>\\n<li>\\n<h3>11/25/19</h3>\\n<p>Rest as needed for the strength.  Keep weights safe. Metcon should be straight forward.</p>\\n</li>\\n<li>\\n<h3>11/26/19</h3>\\n<p>Just a note, this wod showed up at Postal recently.  We\'re not copying them. That\'s all that needs to be said.\\nMetcon: two amraps with no break in between.  On the first one, you can\'t drop the ball.  (or squat and prop it on your legs).  If the ball gets dropped, 5 burpee penalty.  </p>\\n</li>\\n<li>\\n<h3>11/27/19</h3>\\n<p>This is 12 days of christmas style.  It will take > 40 minutes.  DB weights are 50/35 x 2. There should be enogh separation that it works out fine.  If not, it\'s just a workout. Just wait a few seconds.  I think most of the movments are clear.  The format is: 1 x 5 cal AB, 2 bar MU - 1 AB, 3 DB hang clean - 2 bar mu - 1 AB.  All the way until the end.  Scale weights and movments as needed.  </p>\\n</li>\\n<li>\\n<h3>11/29/19</h3>\\n<p>Air squats stay static. HSPU increase by one per round.  Times will be very spread out. </p>\\n</li>\\n<li>\\n<h3>11/30/19</h3>\\n<p>I think it\'s pretty clear.  There will be a lot of waiting around, but there will be enough suck too.  </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 5 of November Cycle","date":"ee"},"fields":{"slug":"nov-19-week5"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 44.51294697903822%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/8160e31ad4103238fb7cfa267c9658f1/2d017/nov-19-week5.jpg\\"\\n        srcset=\\"/7seals/static/8160e31ad4103238fb7cfa267c9658f1/40f63/nov-19-week5.jpg 225w,\\n/7seals/static/8160e31ad4103238fb7cfa267c9658f1/df2c7/nov-19-week5.jpg 450w,\\n/7seals/static/8160e31ad4103238fb7cfa267c9658f1/2d017/nov-19-week5.jpg 900w,\\n/7seals/static/8160e31ad4103238fb7cfa267c9658f1/bbff7/nov-19-week5.jpg 1350w,\\n/7seals/static/8160e31ad4103238fb7cfa267c9658f1/4b9d9/nov-19-week5.jpg 1622w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>12/2/19</h3>\\n<p>This is a tough wod.  The s2oh hits you hard and fast.  3 rounds is great. </p>\\n</li>\\n<li>\\n<h3>12/3/19</h3>\\n<p>Strength: Go as heavy as you can for the emom. Weight is dynamic.  Watch arching of the back.\\nMetcon: Rest built in just to make things worse.  Enjoy. </p>\\n</li>\\n<li>\\n<h3>12/4/19</h3>\\n<p>As always keep an eye on pushup form.  Also, lets pay particular attention to walking lunges.  I\'ve noticed a trend of not standing up entirely (full hip extention).  Lets make sure everyone is finishing their reps. </p>\\n</li>\\n<li>\\n<h3>12/6/19</h3>\\n<p>Figuring out the appropriate weight for this one is going to be difficult.  As noted, if the althlete can do 10+ with the rx weight, they need to be Rx+.  If the athlete doesn\'t have 5 with whatever weight they\'ve choosen, then scale down to a more manageble weight.  This should be a sub 10 minute wod.  In all reality, I\'d like to see it sub 5.  </p>\\n</li>\\n<li>\\n<h3>12/7/19</h3>\\n<p>I think it\'s clear, divide all reps however you choose.  40 total cals on buy in and cash out, not each.  </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 6 of November Cycle","date":"ff"},"fields":{"slug":"nov-19-week6"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 39.18417799752781%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/949c78ef8abac958b5f2559dbd2be542/2d017/nov-19-week6.jpg\\"\\n        srcset=\\"/7seals/static/949c78ef8abac958b5f2559dbd2be542/40f63/nov-19-week6.jpg 225w,\\n/7seals/static/949c78ef8abac958b5f2559dbd2be542/df2c7/nov-19-week6.jpg 450w,\\n/7seals/static/949c78ef8abac958b5f2559dbd2be542/2d017/nov-19-week6.jpg 900w,\\n/7seals/static/949c78ef8abac958b5f2559dbd2be542/bbff7/nov-19-week6.jpg 1350w,\\n/7seals/static/949c78ef8abac958b5f2559dbd2be542/3d2e6/nov-19-week6.jpg 1618w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>12/9/19</h3>\\n<p>Look for times 5-7ish on this.  Maybe let athletes know they can adjust their reps from a \\"hip\\" driven press to a shoulder press.  This seems to move the focus from the quads to the shoulders and helps you keep moving.</p>\\n</li>\\n<li>\\n<h3>12/10/19</h3>\\n<p>If athletes can\'t touch and go with Rx weight for 5 reps with excellent form, they should probably scale.  I think this is an excellent workout, but the potential for injury is certainly there.  </p>\\n</li>\\n<li>\\n<h3>12/11/19</h3>\\n<p>I think the strength is clear. Just to be clear, I\'m looking for a 3 second negative on the first emom. Weight should be static, but I\'m guessing most are going to struggle to find the appropriate weight.  No rest between emoms.  </p>\\n</li>\\n<li>\\n<h3>12/13/19</h3>\\n<p>This one has been tested.  It\'s a pretty crushing. </p>\\n</li>\\n<li>\\n<h3>12/14/19</h3>\\n<p>Most of this is clear, try to keep the strength to arounbd 15 minutes if possible. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 7 of November Cycle","date":"gg"},"fields":{"slug":"nov-19-week7"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 46.35352286773795%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/55ead96232daddd624288fef627ddc8f/2d017/nov-19-week7.jpg\\"\\n        srcset=\\"/7seals/static/55ead96232daddd624288fef627ddc8f/40f63/nov-19-week7.jpg 225w,\\n/7seals/static/55ead96232daddd624288fef627ddc8f/df2c7/nov-19-week7.jpg 450w,\\n/7seals/static/55ead96232daddd624288fef627ddc8f/2d017/nov-19-week7.jpg 900w,\\n/7seals/static/55ead96232daddd624288fef627ddc8f/bbff7/nov-19-week7.jpg 1350w,\\n/7seals/static/55ead96232daddd624288fef627ddc8f/3d2e6/nov-19-week7.jpg 1618w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>12/16/19</h3>\\n<p>Just remember proper KB front rack. Fist under the chin, elbow tucked.  </p>\\n</li>\\n<li>\\n<h3>12/17/19</h3>\\n<p>Times are going to be really spread out on this one.  Capped at 35m</p>\\n</li>\\n<li>\\n<h3>12/18/19</h3>\\n<p>Tested.  It\'s possible to finish, but not likely.  At least not with legit reps.</p>\\n</li>\\n<li>\\n<h3>12/20/19</h3>\\n<p>I think this is clear. </p>\\n</li>\\n<li>\\n<h3>12/21/19</h3>\\n<p>The shoulder to overhead doesn\'t seem so bad.  It is. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 8 of November Cycle","date":"hh"},"fields":{"slug":"nov-19-week8"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 44.51294697903822%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/dc302975580604c67daad616bbdcb0f0/2d017/nov-19-week8.jpg\\"\\n        srcset=\\"/7seals/static/dc302975580604c67daad616bbdcb0f0/40f63/nov-19-week8.jpg 225w,\\n/7seals/static/dc302975580604c67daad616bbdcb0f0/df2c7/nov-19-week8.jpg 450w,\\n/7seals/static/dc302975580604c67daad616bbdcb0f0/2d017/nov-19-week8.jpg 900w,\\n/7seals/static/dc302975580604c67daad616bbdcb0f0/bbff7/nov-19-week8.jpg 1350w,\\n/7seals/static/dc302975580604c67daad616bbdcb0f0/4b9d9/nov-19-week8.jpg 1622w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>12/23/19</h3>\\n<p>Lunge is a single DB. I think this should be easier than the last one on thanksgiving.  Time cap is up to coach.  I doubt anyone is finishing this sub 45 minutes though.  These things are always really hard to tell. Weights are light, I feel like it should move fairly quickly.  Not sure anyone really needs to Rx+.</p>\\n</li>\\n<li>\\n<h3>12/24/19</h3>\\n<p>This feels like you\'re screaming through it. Until the pushups.. Pushups are 40% of the wod. There\'s two movements that we should spend time correcting. Both pushups and situps. </p>\\n</li>\\n<li>\\n<h3>12/27/19</h3>\\n<p>All I can say is blame Lail. I recently did 200 stepups with a 35lb kb.  That took me 12 minutes unbroken. If I\'m remembering correctly, pros were taking an hour or so for this. </p>\\n</li>\\n<li>\\n<h3>12/28/19</h3>\\n<p>Pretty clear, divide all work as needed. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 9 of November Cycle","date":"ii"},"fields":{"slug":"nov-19-week9"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 54.14091470951793%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/d127f9c9110486e0ee7072788420ea02/2d017/nov-19-week9.jpg\\"\\n        srcset=\\"/7seals/static/d127f9c9110486e0ee7072788420ea02/40f63/nov-19-week9.jpg 225w,\\n/7seals/static/d127f9c9110486e0ee7072788420ea02/df2c7/nov-19-week9.jpg 450w,\\n/7seals/static/d127f9c9110486e0ee7072788420ea02/2d017/nov-19-week9.jpg 900w,\\n/7seals/static/d127f9c9110486e0ee7072788420ea02/bbff7/nov-19-week9.jpg 1350w,\\n/7seals/static/d127f9c9110486e0ee7072788420ea02/3d2e6/nov-19-week9.jpg 1618w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>12/30/19</h3>\\n<p>Strength is dynamic. Don\'t get hurt.. Metcon will be spread out, mostly due to HSPU.</p>\\n</li>\\n<li>\\n<h3>12/31/19</h3>\\n<p>We all know Cindy. </p>\\n</li>\\n<li>\\n<h3>1/1/20 wow</h3>\\n<p>21-24 minutes for males? 22-25 female? I think these are great wods, but they do make me nervous.  Weight should be scaled if athlete isn\'t able to touch and go with Rx weight for at least 5 reps.</p>\\n</li>\\n<li>\\n<h3>1/3/20</h3>\\n<p>Heavy day.  Not sure about how the weight will workout on the back squats. All weights are dynamic.</p>\\n</li>\\n<li>\\n<h3>1/4/20</h3>\\n<p>Pretty clear.  Cap decided by coach. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 10 of November Cycle","date":"jj"},"fields":{"slug":"nov-19-week10"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 47.28395061728395%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/8d150b22c8caebda1dca00735d53c348/2d017/nov-19-week10.jpg\\"\\n        srcset=\\"/7seals/static/8d150b22c8caebda1dca00735d53c348/40f63/nov-19-week10.jpg 225w,\\n/7seals/static/8d150b22c8caebda1dca00735d53c348/df2c7/nov-19-week10.jpg 450w,\\n/7seals/static/8d150b22c8caebda1dca00735d53c348/2d017/nov-19-week10.jpg 900w,\\n/7seals/static/8d150b22c8caebda1dca00735d53c348/bbff7/nov-19-week10.jpg 1350w,\\n/7seals/static/8d150b22c8caebda1dca00735d53c348/266b5/nov-19-week10.jpg 1620w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>1/6/20</h3>\\n<p>Pretty clear I think.  Lots of volume..</p>\\n</li>\\n<li>\\n<h3>1/7/20</h3>\\n<p>Strength is static.  Maybe 55-60% or 1rm? Choose a safe weight. Metcon: Shoot for unbroken squats. </p>\\n</li>\\n<li>\\n<h3>1/8/20</h3>\\n<p>Compare to 12/24. Same exact number of reps as everything else.  Just without the 100 push up wall at the end. </p>\\n</li>\\n<li>\\n<h3>1/10/20</h3>\\n<p>This can have two scores or just one.  DU score is the one I\'m interested in.  Turkish getups should be AHAP.\\nEverything else should be max effort.  For athletes who can\'t finish AB/AirRunner/Ski Erg in less than 45 seconds, scale it back.  For the getups, I\'d prefer them be light enough to focus on good safe form instead of trying to fly through the motions. </p>\\n</li>\\n<li>\\n<h3>1/11/20</h3>\\n<p>This sucks.  FYI the wall is at 125 s2oh reps. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 11 of November Cycle","date":"kk"},"fields":{"slug":"nov-19-week11"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 813px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 48.954489544895445%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/4b73e1a83ff54df301cf8efbefbd3a8b/5314a/nov-19-week11.jpg\\"\\n        srcset=\\"/7seals/static/4b73e1a83ff54df301cf8efbefbd3a8b/40f63/nov-19-week11.jpg 225w,\\n/7seals/static/4b73e1a83ff54df301cf8efbefbd3a8b/df2c7/nov-19-week11.jpg 450w,\\n/7seals/static/4b73e1a83ff54df301cf8efbefbd3a8b/5314a/nov-19-week11.jpg 813w\\"\\n        sizes=\\"(max-width: 813px) 100vw, 813px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>1/13/20</h3>\\n<p>First and second round of thrusters shouldn\'t really be unbroken.  Maybe even sets of 5.  I\'d use spare class time to do a gymnastics progression.  Probably not HSPU due to strict press tomorrow. </p>\\n</li>\\n<li>\\n<h3>1/14/20</h3>\\n<p>Strict press is dynamic. Beware of how fast shoulders fail. Err on the side of lighter. Lets just get SLRDL right. Remember, the hand holding the weight is opposite to the foot on the ground. Example: if I\'m standing on my left leg (right leg back), I\'m holding the weight in my right hand. This helps prevent opening the hips up so much. Situps are intentionally done with no abmat.  Less speed, more contraction.  This will probably be the hardest part for most.  </p>\\n</li>\\n<li>\\n<h3>1/15/20</h3>\\n<p>Pretty clear I think. </p>\\n</li>\\n<li>\\n<h3>1/17/20</h3>\\n<p>Again, clear.  Looks innocent. It\'s far from it. Consider scaling back the weights if the athlete can\'t link at least a few TNG reps with the heaviest weight.</p>\\n</li>\\n<li>\\n<h3>1/18/20</h3>\\n<p>Nothing complicated. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 12 of November Cycle","date":"ll"},"fields":{"slug":"nov-19-week12"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 48.084054388133495%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/890904f7f16648cca8129a0ac2441853/2d017/nov-19-week12.jpg\\"\\n        srcset=\\"/7seals/static/890904f7f16648cca8129a0ac2441853/40f63/nov-19-week12.jpg 225w,\\n/7seals/static/890904f7f16648cca8129a0ac2441853/df2c7/nov-19-week12.jpg 450w,\\n/7seals/static/890904f7f16648cca8129a0ac2441853/2d017/nov-19-week12.jpg 900w,\\n/7seals/static/890904f7f16648cca8129a0ac2441853/bbff7/nov-19-week12.jpg 1350w,\\n/7seals/static/890904f7f16648cca8129a0ac2441853/3d2e6/nov-19-week12.jpg 1618w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>1/20/20</h3>\\n<p>Jackie re-test.  Not much to put here. I expect to see some solid PR\'s.</p>\\n</li>\\n<li>\\n<h3>1/21/20</h3>\\n<p>Again pretty straight forward.  Keep an eye on DL form.  Bar path is the biggest fault I see.  The bar floating away from the body is one of the biggest factors for back pain. Bloody shins wins.  </p>\\n</li>\\n<li>\\n<h3>1/22/20</h3>\\n<p>Test 2.  Very clear. Burpees... looking for 6-10. 5 is FAST but possible. 10 is slow and fail. </p>\\n</li>\\n<li>\\n<h3>1/24/20</h3>\\n<p>Modified from the original due to equipment I had involved.  Ignore the max class size part. This should really emphasize that clean and jerk.  </p>\\n</li>\\n<li>\\n<h3>1/25/20</h3>\\n<p>I have absolutely no idea how long this will take. I\'d guess 15-20 minutes.  </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 13 of November Cycle","date":"mm"},"fields":{"slug":"nov-19-week13"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 50.123456790123456%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/ddafd8a2f07bc38170bfc24554531acc/2d017/nov-19-week13.jpg\\"\\n        srcset=\\"/7seals/static/ddafd8a2f07bc38170bfc24554531acc/40f63/nov-19-week13.jpg 225w,\\n/7seals/static/ddafd8a2f07bc38170bfc24554531acc/df2c7/nov-19-week13.jpg 450w,\\n/7seals/static/ddafd8a2f07bc38170bfc24554531acc/2d017/nov-19-week13.jpg 900w,\\n/7seals/static/ddafd8a2f07bc38170bfc24554531acc/bbff7/nov-19-week13.jpg 1350w,\\n/7seals/static/ddafd8a2f07bc38170bfc24554531acc/266b5/nov-19-week13.jpg 1620w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h2>This is an extra week.  Post re-test and prior to another cycle begining. I\'m going to be putting these in after each 3 month cycle.</h2>\\n</li>\\n<li>\\n<h3>1/27/20</h3>\\n<p>I think it\'s pretty clear. Looking for technique more than anything on the snatch. </p>\\n</li>\\n<li>\\n<h3>1/28/20</h3>\\n<p>This gets tough.  Tested. I stayed unbroken on everything and was still mid 19m. That said, strategic rest could be faster. </p>\\n</li>\\n<li>\\n<h3>1/29/20</h3>\\n<p>Alternating on the snatch. Even reps on the lunge.</p>\\n</li>\\n<li>\\n<h3>1/31/20</h3>\\n<p>Step ups are with the kb.  It can be held any way you want.  Squats are held at the chest though.</p>\\n</li>\\n<li>\\n<h3>2/1/20</h3>\\n<p>Borrowed from the internets.... no clue what to expect. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 1 of Feb Cycle","date":"nn"},"fields":{"slug":"feb-20-week1"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 52.86103542234333%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/2d017/week1.jpg\\"\\n        srcset=\\"/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/40f63/week1.jpg 225w,\\n/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/df2c7/week1.jpg 450w,\\n/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/2d017/week1.jpg 900w,\\n/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/bbff7/week1.jpg 1350w,\\n/7seals/static/1f370eabc5e5396848a02c9b1f9746ca/bcb36/week1.jpg 1468w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>2/3/20</h3>\\n<p>Strength: Test.  Pretty simple. Hit the safest 5 rep max you can.  Lets be picky.  I\'d like to see coaches being\\npicky about depth.  A 300# squat above parallel isn\'t really a 300# squat.  I\'d rather see someone improve their form\\nand not increase weight.\\nMetcon: Pretty clear. </p>\\n</li>\\n<li>\\n<h3>2/4/20</h3>\\n<p>!!!!!!!!!Important!!!!!! First minute is 10 alternating kb ground to overhead.  No Ski Erg. 53/35.  Should see some 100 rep scores.  </p>\\n</li>\\n<li>\\n<h3>2/5/20</h3>\\n<p>Most of us have done this.  25+ rounds is legit.</p>\\n</li>\\n<li>\\n<h3>2/7/20</h3>\\n<p>Strength: Dynamic weight at your own risk lol.  Have fun with that.  Score heaviest.\\nStrength 2: Exercises should be done one after the other with minimal rest. Extended rest between rounds is fine.  Choose your weight for SLRDL and step ups.  I\'d avoid a barbell for step ups.  For SLRDL, be sure the hips aren\'t opening up too far.  </p>\\n</li>\\n<li>\\n<h3>2/8/20</h3>\\n<p>Hold DB however you choose. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 2 of Feb Cycle","date":"oo"},"fields":{"slug":"feb-20-week2"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 61.14911080711354%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/2d017/week2.jpg\\"\\n        srcset=\\"/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/40f63/week2.jpg 225w,\\n/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/df2c7/week2.jpg 450w,\\n/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/2d017/week2.jpg 900w,\\n/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/bbff7/week2.jpg 1350w,\\n/7seals/static/77f00d9864efb88d65d6ea2cb2cb467b/38a4f/week2.jpg 1462w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>2/10/20</h3>\\n<p>Nothing complicated.</p>\\n</li>\\n<li>\\n<h3>2/11/20</h3>\\n<p>Strength: I\'d prefer to see this as static weight.  But, I know it\'s going to be hard at 20 reps.<br>\\nStrength 2: Sit-ups should be slow and concentrated. No abmat.  All other weight is AHAP.  </p>\\n</li>\\n<li>\\n<h3>2/12/20</h3>\\n<p>Score rounds and reps.  Start each metcon from the begining and just add all extra reps at the end. </p>\\n</li>\\n<li>\\n<h3>2/14/20</h3>\\n<p>Strength: If the 70lb kb isn\'t heavy enough, feel free to use 2x53\'s.<br>\\nMetcon: I think it\'s pretty clear. </p>\\n</li>\\n<li>\\n<h3>2/15/20</h3>\\n<p>Relay style.  A new round doesn\'t start until last person in group is done with last exercise.  </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 3 of Feb Cycle","date":"pp"},"fields":{"slug":"feb-20-week3"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 737px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 44.09769335142469%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/c19b2d0c6bfc9d4f9dd36c6111f3c7d5/7dae4/week3.jpg\\"\\n        srcset=\\"/7seals/static/c19b2d0c6bfc9d4f9dd36c6111f3c7d5/40f63/week3.jpg 225w,\\n/7seals/static/c19b2d0c6bfc9d4f9dd36c6111f3c7d5/df2c7/week3.jpg 450w,\\n/7seals/static/c19b2d0c6bfc9d4f9dd36c6111f3c7d5/7dae4/week3.jpg 737w\\"\\n        sizes=\\"(max-width: 737px) 100vw, 737px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>2/17/20</h3>\\n<p>Strength: Post the final set of 8. Metcon: Sprint.  </p>\\n</li>\\n<li>\\n<h3>2/18/20</h3>\\n<p>Clean and Jerk weight is Body weight / 70% of body weight. Each round, increase the c&#x26;j reps by 1. Scale weight to a managable, safe weight. </p>\\n</li>\\n<li>\\n<h3>2/19/20</h3>\\n<p>Strength: AHAP. Strength part 2: Reverse lunge can be from the rack. </p>\\n</li>\\n<li>\\n<h3>2/21/20</h3>\\n<p>Wear grips.  </p>\\n</li>\\n<li>\\n<h3>2/22/20</h3>\\n<p>Divide reps however.  <em>Double squat wallball</em> NOT while the ball is in the air.  Squat twice and toss the ball on the second squat. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 4 of Feb Cycle","date":"qq"},"fields":{"slug":"feb-20-week4"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 742px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 39.757412398921836%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/1b5b15b9bcac847ab9311a2357995f2c/31693/week4.jpg\\"\\n        srcset=\\"/7seals/static/1b5b15b9bcac847ab9311a2357995f2c/40f63/week4.jpg 225w,\\n/7seals/static/1b5b15b9bcac847ab9311a2357995f2c/df2c7/week4.jpg 450w,\\n/7seals/static/1b5b15b9bcac847ab9311a2357995f2c/31693/week4.jpg 742w\\"\\n        sizes=\\"(max-width: 742px) 100vw, 742px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>2/24/20</h3>\\n<p>Each working minute should be a sprint. Rest / puke even minutes. Note: some of the recent Rx+ options are to encourage harder metabolic options, not just heavier or more complicated/technical. </p>\\n</li>\\n<li>\\n<h3>2/25/20</h3>\\n<p>I think everything is pretty clear for this heavy day.\\n<a href=\\"https://www.t-nation.com/workouts/6-week-bench-press-cure\\">Dave Tate on Benchpress</a>\\nAnything Dave Tate says about benchpress or squat is bascially 100%.  If you watch the videos, just be aware his vocabulary is about like mine.... There\'s also a wealth of information from him online. </p>\\n</li>\\n<li>\\n<h3>2/26/20</h3>\\n<p>Pretty clear and simple.  Just keep an eye on legit strict pull ups. </p>\\n</li>\\n<li>\\n<h3>2/28/20</h3>\\n<p>Hold the kb with both hands in the front rack, under the chin. *Can hold the bell or the handle.  The important part is tucked under the chin.  </p>\\n</li>\\n<li>\\n<h3>2/29/20</h3>\\n<p>Pretty clear. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 5 of Feb Cycle","date":"rr"},"fields":{"slug":"feb-20-week5"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 68.07065217391305%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/2d017/week5.jpg\\"\\n        srcset=\\"/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/40f63/week5.jpg 225w,\\n/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/df2c7/week5.jpg 450w,\\n/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/2d017/week5.jpg 900w,\\n/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/bbff7/week5.jpg 1350w,\\n/7seals/static/7938d6ac18a74e00f00175b9fdddfe6d/bf340/week5.jpg 1472w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>3/2/20</h3>\\n<p>Strength: Looking for a heavy but safe 8 rep.\\nMetcon: 10-1 burpees, 20-11 russian kb swings.  53/35</p>\\n</li>\\n<li>\\n<h3>3/3/20</h3>\\n<p>Score total.</p>\\n</li>\\n<li>\\n<h3>3/4/20</h3>\\n<p>Just stay safe on the snatch. </p>\\n</li>\\n<li>\\n<h3>3/6/20</h3>\\n<p>Clean and jerk is alternating. This will take some time. 50/35.    </p>\\n</li>\\n<li>\\n<h3>3/7/20</h3>\\n<p>Relay style.  Another round doesn\'t start until the last athlete has complete the deadlift. This should be a LOT of rounds. </p>\\n</li>\\n</ul>"}},{"node":{"frontmatter":{"title":"Week 6 of Feb Cycle","date":"ss"},"fields":{"slug":"feb-20-week6"},"html":"<p><span\\n      class=\\"gatsby-resp-image-wrapper\\"\\n      style=\\"position: relative; display: block; margin-left: auto; margin-right: auto;  max-width: 900px;\\"\\n    >\\n      <span\\n    class=\\"gatsby-resp-image-background-image\\"\\n    style=\\"padding-bottom: 48.5054347826087%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;\\"\\n  ></span>\\n  <img\\n        class=\\"gatsby-resp-image-image\\"\\n        alt=\\"workouts\\"\\n        title=\\"workouts\\"\\n        src=\\"/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/2d017/week6.jpg\\"\\n        srcset=\\"/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/40f63/week6.jpg 225w,\\n/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/df2c7/week6.jpg 450w,\\n/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/2d017/week6.jpg 900w,\\n/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/bbff7/week6.jpg 1350w,\\n/7seals/static/6e8c23f7aa4e23d272a1c17c0e5fc144/bf340/week6.jpg 1472w\\"\\n        sizes=\\"(max-width: 900px) 100vw, 900px\\"\\n        loading=\\"lazy\\"\\n      />\\n    </span></p>\\n<ul>\\n<li>\\n<h3>3/9/20</h3>\\n<p>For Time.. typo.  Linchpin wod.  Looked different. Score total time. 50/35.  Could use KB\'s too. </p>\\n</li>\\n<li>\\n<h3>3/10/20</h3>\\n<p>Strength: Looking to be a little heavier than the last 3x20.  Maybe 5lbs heavier.\\nStrength 2: Bench is by it self.  Then superset pull ups and rows. </p>\\n</li>\\n<li>\\n<h3>3/11/20</h3>\\n<p>Deadlift weight should be a weight athletes can safely TnG 10 reps.</p>\\n</li>\\n<li>\\n<h3>3/13/20</h3>\\n<p>Pretty clear I think.  Time frame is a total guess and I suspect the spread will be wide.   </p>\\n</li>\\n<li>\\n<h3>3/14/20</h3>\\n<p>Snatch can be 5/5 or switch arms each round. Lunges are not weighted. </p>\\n</li>\\n</ul>"}}]}}}')}}]);
